            for j in range(i ** 2, end + 1, i):
                sieve[j] = False
    for i in range(start, end + 1):
        if sieve[i]:
            primes.append(i)
    if len(primes) < 100:
        return sum(primes)
    else:
        return sum(primes[:-100])
